import axios from 'axios'
import userService from '../../../script/doctorService';

const DOCTORS_REST_API_URL = 'http://localhost:8080/api/doctors';

class DoctorService{

    getDoctors(){
        return axios.get(DOCTORS_REST_API_URL);
    }
}

export default new userService();
